  ""query"": ""
SELECT ?hp ?prop ?propLabel ?alcEndpoint ?mpcEndpoint WHERE {
  ?hp a <http://data.ashrae.org/standard223#WatertoWaterHeatPump> .
  ?hp <http://data.ashrae.org/standard223#hasProperty> ?prop .
  OPTIONAL { ?prop <http://www.w3.org/2000/01/rdf-schema#label> ?propLabel . }
  # Ensure property is a QuantifiableObservableProperty (or any quantity)
  ?prop a ?propType .
  FILTER(?propType = <http://data.ashrae.org/standard223#QuantifiableObservableProperty> || ?propType = <http://data.ashrae.org/standard223#QuantifiableActuatableProperty>)

  # Non-writable quantities
  OPTIONAL { ?prop <https://brickschema.org/schema/Brick/writable> ?writable . }
  FILTER (!BOUND(?writable) || ?writable = false)

  OPTIONAL {
    ?prop <http://data.ashrae.org/standard223#hasExternalReference> ?alcRef .
    ?alcRef <https://brickschema.org/schema/Brick/endpoint> ?alcEndpoint .
    FILTER regex(str(?alcEndpoint), \""ALC\"", \""i\"")
  }
  OPTIONAL {
    ?prop <http://data.ashrae.org/standard223#hasExternalReference> ?mpcRef .
    ?mpcRef <https://brickschema.org/schema/Brick/endpoint> ?mpcEndpoint .
    FILTER regex(str(?mpcEndpoint), \""MPC\"", \""i\"")
  }
}
"",
